import React from 'react'
import { Navigate } from 'react-router-dom'
import { useAuth } from '../../utils/useAuth';

function Logout() {
  const {token} = useAuth();
  return (
    <button onClick={()=> localStorage.removeItem("token") && <Navigate to="/login" />}>Logout</button>
  )
}

export default Logout
